import { Box, Flex, Input, Stack, Button } from "@chakra-ui/react";
import Head from "next/head";
import Layout from "@/layout";

export default function Home() {
  return (
    <Layout>
      <Head>
        <title>Create Next App</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>

      <Flex justify="center" align="center" h="calc(100vh - 60px)">
        <Flex
          justify="center"
          borderRadius="md"
          bg="tomato"
          w="sm"
          h="sm"
          px={5}
          align="center"
        >
          <Input bg="white" variant="outline" placeholder="Username" />
          <Input bg="white" variant="outline" placeholder="Password" />
          <Button w="100%" mt={5}>
            Login
          </Button>
        </Flex>
      </Flex>
    </Layout>
  );
}
